import "./product.css";
import Card from 'react-bootstrap/Card';
import CardGroup from 'react-bootstrap/CardGroup';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Button from 'react-bootstrap/Button';

const Product = () => {
  return (
    <div className="p">
        <h1 className="p-centre">Research and Project Overview</h1>
    <CardGroup>
      <col>
      <Card>
        <Card.Body>
          <Card.Title>AnalyzingWeb Application Vulnerability of Educational Institutions in Bangladesh</Card.Title>
          <Card.Text>
            This is a wider card with supporting text below as a natural lead-in
            to additional content. This content is a little bit longer.
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>
      <Card>
        <Card.Body>
          <Card.Title>Contrast Enhancement of Low Light Image</Card.Title>
          <Card.Text>
            Here we discussed about enhancement of different low light images using Histogram Equalization (HE) and Illumination Adjustment.
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>
      </col>
    </CardGroup>
    </div>
  );
};

export default Product;
